window.bookSummaryJSON = "<p>More mutated Australian wildlife than you can shake your beam rifle at....</p> <p>When the System arrives, no one is ready. Most of all Kira Kent, plant biologist and single mum. She's pulling an all-nighter, her children in tow when her beloved wildlife begins to mutate.</p> <p>No more cute koala bears, bouncy kangaroos, or fuzzy wallabies. Now, everything is mutated and aggressive? Who made the spiders so big? The world's most dangerous continent just got a lot more dangerous, and no one, not even the alien Galactics who arrive, are ready for it.</p> <p>Kira is going to have to pull together a community of survivors to forge a safe zone for her son and daughter, figure out a long-term survival plan, and make nice with the aliens. Otherwise, she will see everyone and everything she has loved die.</p> <p><i>The System Apocalypse: Australia</i> omnibus edition includes the first three books in the series:</p> <ul> <li><i>Town Under</i></li> <li><i>Flat Out</i></li> <li><i>Bloody Oath</i></li> </ul> <p>Set in the same universe as Tao Wong's The System Apocalypse and starts in the same time period as <i>Life in the North</i> but focuses on the changes in the deadliest of continentsâ€”Australia. Fans of the original series, LitRPG, fantasy, science fiction, and post-apocalyptic novels will want to take a look.</p>"; 
